          { user ? <div>LOGIN : {user.nickname}</div> : <div>LOGOUT</div>}
          {dummy.isLoggedIn && <PostForm/>}
          {dummy.mainPosts.map((c) => {
            return (
              <PostCard key = {c} post = {c}/>
            )
          })}
        </div>
    </>
  );
};

export default Home;
